package MyFirstProgram;

public class Expression {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int friends = 10;
		
		friends = friends + 1;
		
		int friend = 11;
		
		friend++;
		friend--;
		++friend;
		--friend;
		
		
		System.out.println(friends);
		System.out.println(friend);
	}

}
